import React, { useEffect, useState } from 'react';
import { ITableProps } from '../types/types';
import { MapUtils } from '../utils/MapUtils';
import { proxyUrls } from '../utils/MapConfig';

const Table = (props: ITableProps) => {

    const [table, setTable] = useState([])

    let {
        result
    } = props

    function createTablefromGeoJson() {
        MapUtils.getGeojson(proxyUrls[1])
            .then(data => data)
            .then(featureCollection => featureCollection.jsonb_build_object)
            .then(features => {
                console.log(features.features)
                for (let i = 0; i < features.features.length; i++) {
                    console.log(features.features[i].properties.stt_name)
                    //@ts-ignore
                    setTable(table.push(features.features[i].properties.stt_name))
                }                
            })
            .then(() => console.log(table))
    }


    useEffect(() => {
        createTablefromGeoJson()
        console.log(table)
    }, []);

    return (
        <>

            <ul>
                {table.map(s => (<li>{s}</li>))}
            </ul>


        </>
    )
}

export default Table;
